import React from "react";
import { Component } from "react";
import '../resources/css/login-form.css'

export default class Login extends Component {
    constructor(props) {
        super(props);
        this.state = {
            email: "",
            key: ""
        }
    }

    setValues = (event) => {
        this.setState({
            [event.target.id]: event.target.value
        });
    }

    cleanValues = () => {
        this.setState(
            {
                email: "",
                key: ""
            }
        );
    }

    signIn = (event) => {
        event.preventDefault();

        const url = "http://localhost:8080/login/signIn";
        const user = {
            email: this.state.email,
            key: this.state.key
        }
        const header = {
            method: "POST",
            body: JSON.stringify(user),
            headers: {
                "Content-Type": "application/json"
            }
        }

        fetch(url, header)
            .then(response => {
                if (!response.ok) throw Error(response.status);
                return response.json();
            }
            )
            .then(json => {
                console.log(json);
                localStorage.uuid = json.uuid;
                localStorage.credential = json.credential;
                window.location.href = "/login";
            })
            .catch(error => {
                console.error(error);
                localStorage.clear();
                alert("Credenciales Incorrectas");
            });
        this.cleanValues();
    }



    render() {
        return (
            <>
                <div className="container">
                    <div className="d-flex">
                        <div className="box__back-login">
                            <h3>¿Ya tienes una cuenta?</h3>
                            <p>Inicia sesión para ingresar a la página</p>
                            <button id="btn__login">Iniciar sesión</button>
                        </div>
                    </div>

                    <div className="d-flex">
                        <div className="box__back-signin">
                            <h3>¿Aún no tienes cuenta?</h3>
                            <p>Regístrate para poder ingresar a la página</p>
                            <button id="btn__signin">Registrarse</button>
                        </div>
                    </div>
                    <div className="container__login-signin">
                        <form onSubmit={this.signIn} className="form__login">
                            <h2>Iniciar sesión</h2>
                            <input
                                type="email"
                                id="email"
                                name="email"
                                placeholder="correo electronico"
                                required={true}
                                value={this.state.email}
                                onChange={this.setValues}
                            />
                            <input
                                type="password"
                                id="key"
                                name="key"
                                placeholder="clave"
                                required={true}
                                value={this.state.key}
                                onChange={this.setValues}
                            />
                            <button>Ingresar</button>
                        </form>

                        <form onSubmit={this.signIn} className="form__signin">
                            <input
                                type="email"
                                id="email"
                                name="email"
                                placeholder="correo electronico"
                                required={true}
                                value={this.state.email}
                                onChange={this.setValues}
                            />
                            <input
                                type="password"
                                id="key"
                                name="key"
                                placeholder="clave"
                                required={true}
                                value={this.state.key}
                                onChange={this.setValues}
                            />
                            <button>Registrarse</button>
                        </form>
                    </div>

                </div>

                <form onSubmit={this.signIn}>
                    <input
                        type="email"
                        id="email"
                        name="email"
                        placeholder="correo electronico"
                        required={true}
                        value={this.state.email}
                        onChange={this.setValues}

                    />

                    <input
                        type="password"
                        id="key"
                        name="key"
                        placeholder="clave"
                        required={true}
                        value={this.state.key}
                        onChange={this.setValues}
                    />
                    <div>
                        <button type="submit">Ingresar</button>
                        <button type="reset" onClick={this.cleanValues}>Limpiar</button>
                    </div>
                </form>

                <div>


                </div>
            </>
        );
    }
}
